using System;
using System.Linq;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using AX9.MetaTool;
using AX9.MetaTool.Models;

namespace MetaToolTest
{
    [TestClass]
    public class MetaToolTests
    {
        private const string Test1Desc = "";
        private const string Test1Meta = "";
        private const string Test1Npdm = "";
        private const string Test1Acid = "";

        private const string Test2Desc = "";
        private const string Test2Meta = "";
        private const string Test2Npdm = "";
        private const string Test2Acid = "";

        private const string Test3Desc = "";
        private const string Test3Meta = "";
        private const string Test3Npdm = "";
        private const string Test3Acid = "";


        [TestMethod]
        public void TestNpdmGenerator1() => Assert.IsTrue(TestNpdmGenerator(Test1Desc, Test1Meta, Test1Npdm));
        [TestMethod]
        public void TestNpdmGenerator2() => Assert.IsTrue(TestNpdmGenerator(Test2Desc, Test2Meta, Test2Npdm));
        [TestMethod]
        public void TestNpdmGenerator3() => Assert.IsTrue(TestNpdmGenerator(Test3Desc, Test3Meta, Test3Npdm));


        [TestMethod]
        public void TestAcidGenerator1() => Assert.IsTrue(TestAcidGenerator(Test1Desc, Test1Meta, Test1Acid));
        [TestMethod]
        public void TestAcidGenerator2() => Assert.IsTrue(TestAcidGenerator(Test2Desc, Test2Meta, Test2Acid));
        [TestMethod]
        public void TestAcidGenerator3() => Assert.IsTrue(TestAcidGenerator(Test3Desc, Test3Meta, Test3Acid));


        public bool TestNpdmGenerator(string desc, string meta, string npdm)
        {
            DescModel inDesc = Utils.XMLBase64Deserialize<DescModel>(desc);
            MetaModel inMeta = Utils.XMLBase64Deserialize<MetaModel>(meta);
            byte[] inNpdm = Convert.FromBase64String(npdm);
            byte[] outNpdm = NpdmGenerator.GetNpdmBytes(inDesc, inMeta);

            return inNpdm.SequenceEqual(outNpdm);
        }

        public bool TestAcidGenerator(string desc, string meta, string acid)
        {
            DescModel inDesc = Utils.XMLBase64Deserialize<DescModel>(desc);
            MetaModel inMeta = Utils.XMLBase64Deserialize<MetaModel>(meta);
            byte[] inAcid = Convert.FromBase64String(acid);
            byte[] outAcid = NpdmGenerator.GetAcidBytes(inDesc, inMeta);

            return inAcid.SequenceEqual(outAcid);
        }
    }
}
